description: 'Demographic model of an extended admixture pulse from Neandertals into
  Europeans taken from Iasi et al. (2021), specifically the simple model of Supplementary
  Figure 1a with a gamma-shaped pulse. This model simulates 3 populations: Africans,
  Europeans and Neandertals with an Out-of-Africa event. The population sizes are
  constant with an unidirectional admixture from Neandertals into Europeans after
  the split between Europeans and Africans. The admixture event is modelled as an
  800 generation (20 ky) long extended admixture pulse.'
time_units: years
generation_time: 29
